import React from 'react'
import Brand from '../logo/Brand'
import { Menu } from '../user'

const Navbar = props => {

    let content = (
        <div className="container h-8 w-full flex bg-xw-200">
            <Brand className="h-full ml-2 bg-blue-600"/>
            <Menu className="container w-full flex content-end float-right bg-red-600" username="ilyass"/>
        </div>
    )

    return content
}

export default Navbar
